import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [designs, setDesigns] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const token = localStorage.getItem('token') || 'YOUR_JWT_TOKEN';

    fetch('http://localhost:5000/api/designs', {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    })
      .then((res) => res.json())
      .then((data) => {
        console.log('API Response:', data);
        if (Array.isArray(data)) {
          setDesigns(data);
        } else if (data.designs && Array.isArray(data.designs)) {
          setDesigns(data.designs);
        } else {
          setDesigns([]);
          console.warn('Unexpected API response format');
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching designs:', err);
        setLoading(false);
      });
  }, []);

  if (loading) return <div>Loading designs...</div>;

  if (designs.length === 0) {
    return <div className="p-6">No designs found.</div>;
  }

  return (
    <div className="p-6 bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-6">Your Designs</h1>
      <div className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-4 gap-6">
        {designs.map((design) => (
          <div key={design._id} className="bg-white rounded shadow p-4 flex flex-col items-center">
            <h3 className="font-semibold mb-3 text-center">{design.title}</h3>
            {design.thumbnailUrl ? (
              <img src={design.thumbnailUrl} alt="Thumbnail" className="w-full h-auto rounded" />
            ) : (
              <div className="w-full h-40 bg-gray-200 flex items-center justify-center rounded">
                <span className="text-gray-500">No thumbnail available</span>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
